script: |
  super -f text -I q5787.spq | sort > q5787.out

inputs:
  - name: q5787.spq
    data: |
      SELECT - col0 + + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( - col2 / col0 ) OR NOT ( NULL ) BETWEEN ( col0 * cor0.col1 * - col0 + - col2 ) AND NULL;
  - name: tab2

outputs:
  - name: q5787.out
    data: |
